import React from 'react'

function Banner() {
  return (
    <div>
      <div className="">
        <div className="banner_background">
         <img style={{height:"400px"}} className="image_hidden" src="https://cdn.britannica.com/88/158788-050-314EBC88/Mount-Triumph-height-North-Cascades-National-Park.jpg" alt="image" />
        </div>
      </div>


    </div>
  )
}


export default Banner
